</p></div></div><div id="js_engagementActions" class="col-sm-5 engagementActions"><ul class="actionsContainer nemo_actionsContainer"><li class="actionItem engagement-0-listItem"><a href="#" role="button" data-module-number="1" name="EM_SendMoney_XB" data-pagename="main:walletweb:summary::main" data-pagename2="main:walletweb:summary::main:::" data-track-type="link" class="vx_small-text selectModule nemo_transferSelect js_selectModule"><span class="icon icon-medium icon-send-money" aria-hidden="true"></span><span>Pay or send money</span></a></li><li class="actionItem engagement-2-listItem"></li></ul></div></div></div><hr class="engagementMainBar-separator engagementMainBar-separator_active"><div id="js_emSlideDownContainer" aria-expanded="false" role="alertdialog" tabindex="-1" class="emSlideDownContainer collapseEm hide nemo_emSlideDownContainer" data-em-open="false" data-current-module="" data-new-user="" data-total-percentage="80" data-hide-sneak-peek="true" data-hide-account-completion="false" data-is-first-use-enabled="false" data-auto-open-offer="false"><div id="aria_engagementStatus" data-engagement-stage="accountSetup" class="emModule dimBorderLine js_emModule engagementStatusModule js_engagementStatusModule nemo_engagementStatus " tabindex="-1"><div id="js_BadgeLanding" class="emModuleContent"><div id="profileStateContainer" class="setupbadgeBanner-container js_profileStates nemo_profileStates nemo_badges badgeDisplay"><div class="setupbadgeBanner-container badgeDisplay js_badgeDisplay js_badges js_badgeChild nemo_profileStates nemo_badges active"><p class="statusGreeting vx_h2">Power up more ways to use PayPal</p><div class="tour-container" id="js_tourModule"><button class="vx_btn vx_btn-secondary vx_btn-small btn-startTour js_tourStart nemo_startTour" name="QT_StartTour" data-pagename="main:walletweb:summary::main" data-track-type="link"><span class="tour-icon-play"><span class="tour-play-message">Start tour</span></span></button><div class="tourContent hide" id="js_tourContent"><p class="js_balanceModuleTitle">No PayPal balance? No problem!</p><p class="js_sendMoneyTitle">Want to pay or get paid?</p><p class="js_sendMoneyDescription">Send your family abroad a little something for a gift. Ask a friend to chip in for a bill.</p><p class="js_walletTitle">Edit your ways to pay.</p><p class="js_walletDescription">Be sure to keep your Wallet up to date. A tidy Wallet makes it simple to pay without anyone seeing your financial info.</p><p class="js_settingsTitle">Update your account profile.</p><p class="js_settingsDescription">Something changed? No biggie! Update your profile, password, payment methods, notifications, and more right here.</p><p class="js_fiModule_noFI">Simply <a href="" target="_top" class="popover-link" name="QT_AddCard" data-pagename="main:walletweb:summary:home::QT_AddCard:">link a card.</a> You’ll be all set to instantly shop and spend.</p><p class="js_fiModule_FI">You’ve already linked a payment method. You’re ready to shop and send money.</p><p class="js_conlusionTitle">You’re all set!</p><p class="js_conclusionDescription">Now that we’ve covered the basics, have fun <a href="/deals" target="_top" class="popover-link" name="QT_Shopping" data-pagename="main:walletweb:summary:home::QT_Shopping:">shopping,</a> <a href="" target="target=" _top"="" class="popover-link" name="QT_SendRequestLink" data-pagename="main:walletweb:summary:home::QT_SendRequestLink:">sending and requesting money</a>, and more.</p></div><div class="js_tourContainer hide"><div class="popover" role="tooltip"><div class="arrow"></div><h3 class="popover-title"></h3><div class="popover-content"></div><div class="popover-navigation"><div class="btn-group"><button class="vx_btn vx_btn-medium vx_btn_reversed tour-btn nemo_next js_popover-next" data-role="next">Next</button><button class="vx_btn-link popover-link_endTour vx_text-body_secondary nemo_endTour popover-link js_popover-endLink" data-role="end">End tour</button></div></div></div></div></div><ul id="js_profileStates" class="profileStates nemo_profileStates"><li class="setupStep-state nemo_account nemo_account_created nemo_setup_button setupStep-doneState accountCreated"><span class="icon icon-medium icon-checkmark-small setupStep-icon" aria-hidden="true"></span><span class="setupStep-stateContent">Account created</span></li><li class="setupStep-state nemo_email nemo_setup_button setupStep-doneState"><span class="icon icon-medium icon-checkmark-small setupStep-icon" aria-hidden="true"></span><span class="setupStep-stateContent">Email confirmed</span></li><li class="setupStep-state nemo_card nemo_setup_button setupStep-doneState"><span class="icon icon-medium icon-checkmark-small setupStep-icon" aria-hidden="true"></span><span class="setupStep-stateContent">Card linked</span></li><li class="setupStep-state nemo_mobile nemo_setup_button"><a href="#" target="_top" class="setupStep-mainLink js_setupStep nemo_setupStep-mainLink" name="EM_Mobile_Confirmed" data-pagename="main:walletweb:summary::main" data-pagename2="main:walletweb:summary::main:::" data-track-type="link"><span class="setupStep-container"><span class="icon icon-medium icon-phone setupStep-icon" aria-hidden="true"></span><span class="setupStep-stateContentContainer"><span class="setupStep-cta">Confirm mobile</span></span></span><span class="setupStep-overlayContainer"><span class="setupStep-overlayIconContainer"><span class="setupStep-overlayIconSubContainer  setupStep-overlayIconSubContainer_phone"><span class="setupStep-inlineIcon"><span class="icon icon-medium icon-phone"></span></span></span></span><span class="setupStep-overlayCtaContainer"><span class="setupStep-overlayCta">Confirm mobile</span><span class="setupStep-overlayContent">Extra protection for your account.</span></span></span></a></li></ul></div></div><a href="#" class="js_dismiss engagementStatusModuleClose emClose emClose_acctCompletion nemo_emClose" role="button" data-pagename="main:walletweb:summary::main" data-pagename2="main:walletweb:summary::main:::" data-track-type="link" name="EM_BadgeSetup_Close"><span class="icon icon-small icon-close-small" aria-hidden="true"></span><span class="speakableText">close</span></a></div></div><div class="emModule js_emModule transferBannerContainer nemo_EM_SendMoneyBanner" data-is-sneak-peek-available="true" data-sneak-peek-texts="[&quot;Send money between friends. It’s free if you’re both in the U.S. and you use your bank or balance.&quot;, &quot;Send money to a friend, even if they’re not on PayPal yet.&quot;, &quot;Sending money is the simple way to pay someone back right away.&quot;]" data-sneak-peek-link-name="[&quot;SneakPeek_SendMoney_Free&quot;, &quot;SneakPeek_SendMoney_Unilateral&quot;, &quot;SneakPeek_SendMoney_Simple&quot;]" data-bg-img=""><div class="emModuleContent"><div class="mpiBannerContainer js_mpiBannerContainer transferBanner"><div class="row"><div class="col-xs-4 transferActionColumns"><a href="#" target="_top" class="nemo_primaryActionButton_transferBuy transferPrimaryActions" name="EM_BUY_CTA" data-pagename="main:walletweb:transfer:buy:start" data-pagename2="main:walletweb:transfer:buy:start:::" data-track-type="link"><span class="icon icon-register engagementAction-icon_transferDesktop" aria-hidden="true"></span><span class="transferPrimaryActionContent vx_h3">Pay for goods or services</span></a><p class="transferPrimaryActionBody"><span class="icon icon-shield engagementAction-icon_transfer-shield" aria-hidden="true"></span>Covered by <a href="/us/webapps/mpp/paypal-safety-and-security" target="_blank" class="transferSecondaryActionText nemo_secondaryAction_transferPurchaseProtection" name="emOfferTransferBuySecondaryAction" data-pagename="main:consumer:summary::main" data-pagename2="main:consumer:summary::main:::" data-track-type="link">PayPal Protection for buyers</a>.<br>No fee for you. The seller pays a fee.</p></div><div class="col-xs-4 transferActionColumns"><a href="#" target="_top" class="nemo_primaryAct